  "91ff22cfdfae4000a6d9": "PCI DSS (Payment Card Industry Data Security Standard) ist der globale Datensicherheitsstandard für die Zahlungskartenindustrie. PCI DSS wurde von großen Kreditkartenorganisationen wie Visa, MasterCard und American Express entwickelt und zielt darauf ab, Karteninhaberdaten zu schützen und Kreditkartenbetrug, Hacking und Sicherheitslücken zu verhindern.\n\nPCI DSS besteht aus 12 zentralen Sicherheitsanforderungen, die Netzwerksicherheit, Datenschutz, Schwachstellenmanagement, Zugriffskontrolle, Netzwerküberwachung und Informationssicherheitsrichtlinien umfassen. Alle Händler und Dienstleister, die Kreditkarteninformationen verarbeiten, speichern oder übermitteln, müssen diese Standards einhalten.\n\n{brandName} ist PCI-zertifiziert und zeigt damit, dass seine Datensicherheitsmaßnahmen international anerkannten Standards entsprechen. Diese Zertifizierung gewährleistet einen wirksamen Schutz der Kreditkarteninformationen und anderer sensibler Daten der Kunden vor Verstößen und Betrug.",
  "91xXw22xZhCYxYVeDdhx4i": "Maximale Anzahl der hochgeladenen Dateien: {num}.",
