  "9b49625b13694000aa6f": "Das Kontosicherheitssystem von {brandName} besteht aus zwei Teilen: Verifizierung und Risikokontrolle. Unser Risikokontrollprotokoll setzt Anti-Phishing-Strategien für verschiedene Szenarien wie Anmeldungen, Abhebungen und Änderungen der Sicherheitseinstellungen ein. Es wertet Benutzergeräte, IP-Adressen und früheres Verhalten aus, um potenzielle Risiken einzuschätzen. Wenn ein Risiko erkannt wird, werden je nach Szenario zusätzliche Verifizierungsschritte eingeleitet, um die Sicherheit der Konten zu gewährleisten.",
