  "a3ad8ebe7d904000af8e": "Wenn Benutzer eine API erstellen oder auf die API-Verwaltungsseite zugreifen, können Auszahlungen nur von der IP-Adresse des Benutzers und den angegebenen Auszahlungsadressen vorgenommen werden. Dadurch wird das Risiko einer Sicherheitsverletzung effektiv reduziert, falls ein API-Schlüssel durchgesickert ist oder verloren geht.",
