  "a775e0c384f34000a3a8": "{brandName} implementiert die Berechtigungstrennung für Benutzer-KPIs, einschließlich allgemeiner Berechtigungen, Spothandels-, Margin- und Futures-Berechtigungen. Unterschiedliche Berechtigungsstufen entsprechen unterschiedlichen Vorgängen und verhindern so berechtigungsübergreifende Aktionen. Um Berechtigungen zu ändern, müssen sich Benutzer zunächst bei ihren Konten anmelden, um die Sicherheit ihrer Gelder zu gewährleisten.",
