  "a840f10cc4cf4000a46e": "API-Schlüssel und Kontotrennung",
  "a8TpUFNDSYShm4cRjT5y1b": "Mehr erfahren",
  "a8c95b5ee1ea4000aebf": "Der Schutz der Privatsphäre der Nutzer hat für uns oberste Priorität. {brandName} setzt fortschrittliche Sicherheitsmaßnahmen ein, um die Vertraulichkeit der Daten zu gewährleisten und unbefugten Zugriff zu verhindern. Sensible Daten, einschließlich Passwörter, Transaktionsschlüssel und persönliche Identifikationsinformationen, werden durch strengste Maßnahmen geschützt. Diese Daten werden mit Zero-Knowledge-Proof-Methoden verarbeitet, wodurch sichergestellt wird, dass selbst die Plattform nicht ohne ausdrückliche Nutzerautorisierung auf diese Informationen zugreifen kann. Darüber hinaus werden alle sensiblen Daten mithilfe fortschrittlicher Verschlüsselungsalgorithmen verschlüsselt, um die Sicherheit weiter zu erhöhen.\n\nDie Plattform verwendet speziell entwickelte, dedizierte Datenbanksysteme zur Speicherung sensibler Informationen und bietet so eine zusätzliche Sicherheitsebene. Daher werden diese Datenbanken in streng kontrollierten internen Netzwerkumgebungen betrieben. Containerisierungsmethoden stellen dann sicher, dass jeder Dienst in einem separaten Container ausgeführt wird, wodurch die Dienste durch ein gewisses Maß an Isolation voneinander getrennt bleiben. Dieser Ansatz stellt sicher, dass Dienste auch innerhalb der Plattform nicht auf sensible Daten zugreifen können. Die auf diese Weise durchgeführte Datensicherheit hält die Plattform stabil und skalierbar.",
  "a8oyZqZr6dz72wSfrpqKCc": "Basis",
  "a9b72c3a46494000a10c": "1. Wir arbeiten mit lizenzierten Institutionen zusammen und bündeln regelmäßig Gelder auf zuverlässigen institutionellen Bankkonten, um die Sicherheit der Benutzergelder zu gewährleisten.\n2. Stellen Sie sicher, dass der Kontoname des Einzahlers mit dem Konto des Benutzers übereinstimmt, um Betrug und Compliance-Risiken vorzubeugen.\n3. Stellen Sie sicher, dass der Kontoname des Empfängers mit dem Konto des Benutzers für Abhebungen übereinstimmt, um Betrug und Compliance-Risiken vorzubeugen.\n4. Alle Ein- und Auszahlungstransaktionen erfordern den Abschluss einer erweiterten KYC-Überprüfung (Know Your Customer).",
  "a9dae303ab5e4000a56d": "Passwörter und andere sensible Daten sind ohne ausdrückliche Nutzerberechtigung nicht zugänglich. {brandName} verwendet eine strikte Authentifizierung für alle internen Anfragen und stellt so sicher, dass nur autorisierte Dienste Daten austauschen können. Die rollenbasierte Zugriffskontrolle (RBAC) begrenzt den Zugriff auf sensible Daten für notwendige Vorgänge und verhindert, dass selbst autorisierte Nutzer und Dienste ihre Berechtigungen überschreiten.\n\nFür zusätzliche Sicherheit führen wir regelmäßig Sicherheitsaudits und Schwachstellenscans durch, um sicherzustellen, dass alle Systeme den neuesten Standards und Best Practices entsprechen. Das {brandName}-Sicherheitsteam überwacht aufkommende Bedrohungen genau und reagiert schnell auf mögliche Vorfälle. Nicht zuletzt erhalten die Mitarbeiter auch regelmäßige Sicherheitsschulungen, um die besten täglichen Sicherheitspraktiken einzuhalten.\n\nDa Ihr Vertrauen für uns an erster Stelle steht, verpflichtet sich {brandName} zum Schutz der Privatsphäre und Sicherheit der Nutzerdaten. Wir verbessern ständig unsere Sicherheitsmaßnahmen, um uns besser vor immer ausgefeilteren Cyber-Bedrohungen zu schützen. Diese Maßnahmen zielen darauf ab, eine sichere Trading-Umgebung zu schaffen, die es unseren Nutzern ermöglicht, vertrauensvoll und sicher zu traden.",
