  "asset.debts": "Verbindlichkeiten",
  "asset.faq.answer.one": "Das Finanzierungskonto wird für Krypto-Einzahlungen, -Auszahlungen und -Käufe über Kredit-/Debitkarten sowie für Margin-Kredite verwendet. Das Handelskonto wird für den Krypto-Handel verwendet. Das Margin-Konto wird für die Aufnahme von Krediten und den Handel mit Margin verwendet. Das Futures-Konto wird für den Handel mit Futures-Handel verwendet. Das Finanzkonto wird für Staking und Finanzmanagement verwendet und bietet einen jährlichen Gewinn von bis zu 20 %.",
  "asset.faq.answer.oneNew": "Das Finanzierungskonto wird für Krypto-Einzahlungen, -Auszahlungen und -Käufe über Kredit-/Debitkarten sowie für Margin-Kredite verwendet. Das Handelskonto wird für den Krypto-Handel verwendet. Das Margin-Konto wird für die Aufnahme von Krediten und den Handel mit Margin verwendet. Das Futures-Konto wird für den Handel mit Futures-Handel verwendet. Das Finanzkonto dient dem Staking und der Finanzverwaltung, mit einem jährlichen Gewinn von bis zu 20 %.",
  "asset.faq.answer.two": "Kredite beziehen sich auf den Betrag an Krypto, der vom Finanzierungskonto auf dem Margin-Markt verliehen wurde. Verbindlichkeiten beziehen sich auf den Betrag an Kryptowährungen, der auf dem Margin-Konto auf dem Margin-Markt aufgenommen wurde. Sowohl Verbindlichkeiten als auch Darlehen sind im geschätzten Wert Ihres Kontos enthalten. Hinweis: Kredite generieren keinen KCS-Bonus, Verbindlichkeiten hingegen schon.",
  "asset.faq.question.one": "Was sind die Unterschiede zwischen dem {brandName}-Finanzierungskonto, dem Handelskonto, dem Margin-Konto, dem Futures-Konto und dem Finanzierungskonto?",
