  "assets.por.audit.intro.info": "Die Kapitalien zum Zeitpunkt {auditTime} UTC werden verschlüsselt und in einem Merkle-Baum zusammengefasst. Die Vermögensdaten des Girokontos sind das Merkle-Blatt. Solange die Merkle-Root unverändert bleibt, können die Kapitalien, die dem Merkle-Blatt entsprechen, nicht manipuliert werden.",
  "assets.por.audit.intro.title": "Hinweis",
