  "assets.por.audit.now": "Jetzt verifizieren",
  "assets.por.audit.progress": "Audit-Prozess",
  "assets.por.audit.progress.content1": "Zu einem bestimmten Zeitpunkt werden alle Nutzer-Kapitalien in einem Snapshot verwahrt und verschlüsselt. Der Prüfer stellt sicher, dass jedes Kapital des Nutzers erfasst wird.",
  "assets.por.audit.progress.content2": "Der UID-Hash und der Saldo eines jeden Nutzers bilden ein Merkle-Blatt, während die Summe aller Vermögenswerte des Nutzers den Merkle-Baum bildet. <br/> Sobald der Merkle-Baum erstellt ist, werden alle Änderungen identifiziert.",
  "assets.por.audit.progress.content3": "Reserven zum Zeitpunkt des Snapshots = Vermögen in Wallet-Adressen / Gesamtvermögen im Merkle-BaumZum Zeitpunkt des Snapshots, die entsprechenden überprüfbaren Adressen jeder Art von Vermögen und ihre Blockhöhen.<br/>\nEs gibt auch eine spezielle Audit-Methode, um den Besitz von Wallet-Adressen zu verifizieren.",
  "assets.por.audit.progress.content4": "Reserven zum Snapshot-Zeitpunkt = Vermögen in Wallet-Adressen / Gesamtvermögen im Merkle-Baum.",
