  "assets.por.audit.type": "Prüfungstyp",
  "assets.por.audit.verify": "Verifizierungsprozess",
  "assets.por.audit.verify.content1": "Beachten Sie, dass Faktoren wie der Zeitpunkt des Snapshots und das eingebrachte Kapital zu Abweichungen von Ihrem aktuellen Konto führen können.",
  "assets.por.audit.verify.content2": "Verifizierung bestanden. Das eigene Vermögen ist sicher verwahrt und geschützt.<br/>\nDa jeder an der Verifizierung teilnehmen kann, ist die Gesamtsumme des Vermögens der Nutzer auf der Plattform vertrauenswürdig.",
