  "assetsBack.cs.airCoin.applyDes": "Bitte prüfen Sie die Details Ihres Antrags. Nach der Genehmigung teilen wir Ihnen die anfallende Servicegebühr mit, die von Ihrem Finanzierungskonto eingespart wird, um die Wiederherstellung des Kapitals abzuschließen. <br>Wenn Ihr Kapital nicht wiedererlangt werden kann oder wenn der Grund für das Scheitern der Einzahlungen nicht auf einen Fehler Ihrerseits zurückzuführen ist, fallen keine Gebühren an. Wenn Sie mit diesen Bedingungen einverstanden sind, klicken Sie auf Bestätigen und wir werden mit Ihrer Anfrage fortfahren.",
  "assetsBack.cs.airCoin.reason1": "<span>Wenn das Blockchain-Netzwerk der eingezahlten Kryptowährung auf {brandName} nicht unterstützt wird oder <span class='{style}'>wenn die von Ihnen eingezahlte Kryptowährung auf {brandName} nicht gelistet oder dekotiert ist</span>, wird die Einzahlung nicht gutgeschrieben.</span>",
  "assetsBack.cs.airCoin.reason2": "<span>Zur Sicherheit Ihres Geldes <span class='{style}'>können wir Ihre Einzahlungen nur an die ursprüngliche Blockchain-Adresse zurückschicken, sobald diese genehmigt ist. Die TxID der Rückerstattung wird bereitgestellt. Wenn Sie besondere Umstände haben, wenden Sie sich bitte an unseren offiziellen Kundensupport unter support@kucoin.com.</span> Wenn die Quelladresse der Einzahlung eine andere Plattform ist, setzen Sie sich bitte für die weiteren Schritte mit der jeweiligen Plattform in Verbindung, sobald wir die Rückerstattung bei uns abgeschlossen haben.</span>",
  "assetsBack.cs.airCoin.title": "Einzahlungen mit nicht unterstützten Chains/nicht gelisteten Coins",
  "assetsBack.cs.refundAddress.title": "Rückerstattungsadresse",
  "assetsBack.cs.refundAddress.title.warn": "Bitte achten Sie darauf, dass Ihre Rücksendeadresse mit der ursprünglichen Versandadresse übereinstimmt.",
  "assetsBack.feeStatus01": "Noch festzulegen",
  "assetsBack.feeStatus02": "Abgezogen",
