  "assetsBack.feeStatus05": "Abzug fehlgeschlagen",
  "assetsBack.feeStatus06": "Rückerstattet",
  "assetsBack.form.errMsg5": "Ungültiges Format. Es werden nur Dateien vom Typ {type} unterstützt.",
  "assetsBack.form.tips1": "Um die Sicherheit Ihrer Einzahlungen zu gewährleisten, <span class='{style}'>können wir Ihre eingezahlten Gelder nur an die Quelladresse zurückschicken, ohne irgendwelche Notizen, Tags oder Nachrichten.</span> Wenn die Quelladresse der Einzahlung einer Plattform gehört, kontaktieren Sie diese Plattform für weitere Unterstützung, nachdem KuCoin Ihre Gewinne eingezahlt hat. Wenn es besondere Umstände gibt, kontaktieren Sie uns unter support@kucoin.com.",
  "assetsBack.form.tips2": "Hinweis: Um Ihr Kapital zu schützen, können wir wieder eingezahlte Gelder nur an die ursprüngliche Einzahlungsadresse zurückgeben (d.h. an die Adresse, von der aus sie in der Blockchain gesendet wurden). Bei besonderen Umständen wenden Sie sich bitte an unseren Kundendienst unter support@kucoin.com. Wenn es sich bei der Rückgabeadresse um eine Hot Wallet-Adresse handelt, die zu einer anderen Plattform gehört, müssen Sie sich an diese Plattform wenden, um weitere Unterstützung zu erhalten, sobald die Rückerstattung auf unserer Seite abgeschlossen ist.",
  "assetsBack.form.tooltip1": "Wählen Sie die eingezahlte Coin aus dem Dropdown-Menü. Wenn Sie Ihre Coin nicht sehen, geben Sie sie manuell ein.",
  "assetsBack.reason1": "Sie haben bei der Einzahlung vergessen, einen Tag/Memo anzugeben, oder diesen falsch angegeben.",
  "assetsBack.reason1.confirmModelDes": "Bestätigen Sie, dass die Angaben in Ihrem Antrag korrekt sind. Sobald Ihr Antrag genehmigt ist, werden wir Sie benachrichtigen, damit Sie die entsprechenden Gebühren bezahlen können. Nach Fertigstellung Ihres Antrags erhalten Sie von uns die TxID der zurückgegebenen Kaution.",
  "assetsBack.reason1.des1": "Bei bestimmten Kryptowährungen wie XLM, EOS und XRP muss während des Einzahlungsvorgangs ein Tag oder Memo eingegeben werden. Wenn Sie sowohl die Adresse als auch die Markierung nicht korrekt eingeben, wird die Einzahlung fehlschlagen.",
  "assetsBack.reason1.des2": "Um die Sicherheit Ihrer Einzahlungen zu gewährleisten, <span class='{style}'>können wir die eingezahlten Gewinne nur an die Herkunftsadresse zurückschicken, ohne irgendwelche Notizen, Tags oder Nachrichten. Die TxID der zurückgegebenen Gewinne wird Ihnen mitgeteilt.</span> Wenn die Quelladresse der Einzahlungen zu einer anderen Plattform gehört, müssen Sie diese für weitere Unterstützung kontaktieren, sobald wir die Rückgabe bei uns abgeschlossen haben. Wenn Sie besondere Umstände haben, wenden Sie sich an uns unter support@kucoin.com.",
  "assetsBack.reason1.des3": "Wenn Sie versehentlich einen Tag oder eine Notiz angegeben haben, die einem anderen Nutzer gehört, wurden Ihre Einzahlungen möglicherweise stattdessen auf dessen Konto aufgeladen. In solchen Fällen können wir Ihnen leider nicht weiterhelfen.",
  "assetsBack.reason2": "Sie haben eine Coin eingezahlt, die nicht auf {brandName} gelistet ist.",
  "assetsBack.reason2.des3": "Da das Aufladen der Gelder erhebliche Ressourcen erfordert, wird <span class='{style}'>eine Dienst-Gebühr von {fee} USDT in Rechnung gestellt. Bevor Sie Ihren Antrag einreichen, vergewissern Sie sich, dass der verfügbare Saldo auf Ihrem Finanzierungskonto höher ist als <span style='color:#2DBD96'>{fee} USDT</span></span>.",
