  "beginnerZone.rule.item1": "1. Das Event beginnt am {date} und dauert eine begrenzte Zeit.",
  "beginnerZone.rule.item2": "2. Registrieren Sie sich für eine Mystery Box und gewinnen Sie bis zu {num1} USDT. Nur neue Nutzer, die sich während des Events erfolgreich bei {brandName} registriert haben, sind teilnahmeberechtigt. Nach der Registrierung erhalten neue Nutzer eine Chance auf den Gewinn einer Mystery Box im Wert von bis zu {num2} USDT.",
  "beginnerZone.rule.item3": "3. Schließen Sie Ihre erste Einzahlung/ Ihren ersten Kryptokauf ab und gewinnen Sie bis zu {num1} USDT. Nur Nutzer, die vor dem Event noch nie eine Einzahlung getätigt oder Kryptokauf auf {brandName} getätigt haben, sind teilnahmeberechtigt. Nutzer, deren erste Einzahlung/Kryptokauf im Wert von {num2} USD oder mehr beträgt (Einzahlungen/Käufe aller Kryptowährungen sind teilnahmeberechtigt, der Betrag wird auf der Grundlage des Kurses der Kryptowährung zum Zeitpunkt der Einzahlung/des Kaufs berechnet), können an der Verlosung einer Mystery Box im Wert von bis zu {num3} USDT.",
  "beginnerZone.rule.item4": "4. Nutzer können Krypto über Fast Trade, P2P und Zahlungen von Dritten einzahlen oder kaufen, um die Aufgabe zu erfüllen. Rote Pakete und Testgelder zählen nicht.",
  "beginnerZone.rule.item5": "5. Schließen Sie Ihren ersten Handel ab und gewinnen Sie bis zu {num1} USD. Nur Nutzer, die vor dem Event noch nie auf {brandName} gehandelt haben, sind teilnahmeberechtigt. Nutzer, deren erster Handel einen Wert von {num2} USD oder mehr beträgt und während des Events getätigt wird, nehmen an der Verlosung von zwei Mystery Boxen im Wert von bis zu {num3} USD. Handelsvolumen mit einem Trading-Gebührensatz von 0 wird für die Zwecke dieses Events nicht gezählt.",
  "beginnerZone.rule.item6": "6. Zu den gültigen Geschäften gehören Futures Trading, Spot Trading, Käufe von {brandName} Earn-Produkten, durch Trading-Bots getätigte Geschäfte und Margin Trading. Die Werte werden auf der Grundlage des Transaktionsbetrags zum Zeitpunkt der erfolgreichen Order-Platzierung berechnet.",
  "beginnerZone.rule.item7": "7. Es kann zu einer Verzögerung bei der Aktualisierung der Daten kommen. Wenn die Daten nicht aktualisiert wurden, versuchen Sie, die Seite zu aktualisieren, oder wenden Sie sich an den Kundendienst.",
  "beginnerZone.rule.item8": "8. Belohnungen werden in der Regel innerhalb von {num} Tagen erhalten, aber es kann zu Verzögerungen kommen. Wenn Sie einen Fiat-Abzugscoupon verwenden, wird Ihnen der eingesparte Betrag nach der Bestellung zurückerstattet.",
  "beginnerZone.rule.item9": "9. Zu den Belohnungen in den Mystery Boxen können gehören: Futures Abzugscoupons, Futures-Testgelder, Rate-up-Coupons, Fiat-Abzugscoupons, Hot Coins, Trading-Gebühren-Rabattcoupons, Margin-Boni, zinsfreie Coupons und mehr!",
  "beginnerZone.rule.other": "Weitere Regeln",
  "beginnerZone.rule.other.item1": "1. Die Belohnungen müssen innerhalb von {num} Tagen eingelöst werden, sonst verfallen sie.",
  "beginnerZone.rule.other.item2": "2. Unterkonten sind für dieses Event nicht qualifiziert. Einzahlungen, die über Unterkonten getätigt werden, werden nicht berücksichtigt.",
  "beginnerZone.rule.other.item3": "3. Die USD-Werte von Einzahlungen und Trades während dieses Events werden anhand von Echtzeit-Wechselkursen berechnet.",
  "beginnerZone.rule.other.item4": "4. {brandName} behält sich das Recht vor, Teilnehmer zu disqualifizieren und deren Belohnungen zu widerrufen, wenn sie in betrügerische oder illegale Aktivitäten verwickelt sind.",
  "beginnerZone.rule.other.item5": "5. {brandName} behält sich das Recht vor, dieses Event abzusagen, zu ändern oder die Regeln für dieses Event zu ändern.",
  "beginnerZone.rule.other.item6": "6. Alle Teilnehmer müssen sich strikt an die Nutzungsbedingungen von {brandName} halten.",
  "beginnerZone.rule.other.item7": "7. {brandName} behält sich alle Rechte an der endgültigen Auslegung des Events vor. Wenn Sie Fragen haben, wenden Sie sich an den Kundendienst.",
