  "cTqCKJWMgZatbJz6nNJiG8": "Gesamtschulden",
  "cUcTs3UQjNCKViLLG1ReFE": "Nach der Fusion war der nächste bedeutende Meilenstein von Ethereum <a href='{url}' target='_blank'>Shanghai/Capella-Upgrade</a> im April 2023. Durch dieses Upgrade wurden die Netzwerkfähigkeiten erheblich verbessert, insbesondere durch die Möglichkeit, abgesteckte ETH abzuheben. Diese Funktion war ein wichtiger Schritt, um das Abstecken von Ethereum für die breitere Krypto-Community zugänglicher zu machen.",
  "cUhzWF2wWog7MYqXRWwSTv": "Unterkonten unterstützen nur den Export von Spot-Handel, Margin-Handel, Futures-Handel und Konvertierungsaufträgen.",
  "cWEVRDeZQNd55sy1RGC9aM": "Auto-Compound fehlgeschlagen.",
