  "cbEmWHKoEsh65U2FQhGwSY": "Das Upgrade wird in Phasen eingeführt. Seien Sie versichert, dass alle Vermögenswerte und Aktivitäten von diesem Vorgang unberührt bleiben. Weitere Einzelheiten entnehmen Sie bitte den entsprechenden Ankündigungen.",
