  "creator.fifth.step1.sub": "Blättern Sie durch die Liste der Themen für den aktuellen Monat und wählen Sie die Themen aus, die Sie interessieren. Vergewissern Sie sich vor der Erstellung, dass Sie die Regeln und Anforderungen der von Ihnen gewählten Themen kennen.",
