  "creator.fifth.step4.sub2": "Vergewissern Sie sich, dass Sie alle Schritte abgeschlossen haben und Ihre Arbeit vor dem letzten Tag eines jeden Monats einreichen. Wenn Sie dies nicht tun, verlieren Sie Ihren Anspruch auf die Belohnung.",
