  "creator.ninth.item6.sub": "Mit der Teilnahme an diesem Programm erklären Sie sich damit einverstanden, die Urheberrechte an Ihren Werken an {brandName} zu übertragen. {brandName} behält sich alle Rechte vor, die Regeln dieses Programms zu ändern.",
