  "creator.sixth.item3.title": "{brandName} Zertifizierter Creator",
  "creator.sixth.title": "Zusätzliche Boni für Creators",
  "creator.third.li1": "Das Programm wird jeden Monat eine Veranstaltung mit verschiedenen Themen anbieten, aus denen die Creators wählen können. Creators können die Themen auswählen, an denen sie interessiert sind, und ihre Inhalte für {brandName} bereitstellen. Für jeden von {brandName} ausgewählten Beitrag erhalten Sie 500 $ in Bitcoin.",
