  "etf.action.toTrade": "Handel",
  "etf.answer.five.content1": "i. Handelsgebühren: Werden beim Kauf/Verkauf der gehebelten Tokens auf dem Spot-Markt erhoben. Sie entsprechen der Höhe der Gebühren beim Spot-Trading.",
  "etf.answer.five.content2": "ii. Abonnement-Gebühr: Wird erhoben, wenn ein gehebelter Token abonniert wird. Die Gebühr beträgt derzeit {feeRate}% eines jeden Abonnements.",
  "etf.answer.five.content3": "iii. Einlösungsgebühr: Wird erhoben, wenn Sie einen gehebelten Token einlösen. Die Gebühr beträgt derzeit {feeRate}% einer jeden Einlösung.",
  "etf.answer.five.content4": "iv. Management-Gebühr: Wird täglich um 07:45 Uhr (UTC+8) in Höhe von {managementFees}% erhoben. Die Gebühr ist im Nettowert der gehebelten Tokens enthalten und wirkt sich nicht auf Ihre Positionen aus. Da die Management-Gebühren täglich automatisch berechnet werden, sollten Trader Vorsicht walten lassen, wenn sie planen, gehebelte Tokens längerfristig zu halten.",
  "etf.answer.five.tilte": "Die Gebühren für {brandName} Gehebelte Tokens lauten wie folgt:",
  "etf.answer.one": "{brandName} Gehebelte Tokens sind handelbare Vermögenswerte auf dem {brandName} Spotmarkt. Sie ermöglichen eine Hebelwirkung auf Profite, indem sie Long/Short-Positionen auf den zugrunde liegenden Vermögenswert bilden. Wenn der BTC-Preis beispielsweise um 1% steigt, steigt der Preis von BTC3L um 3% und der Preis von BTC3S fällt um 3%. Im Gegensatz zum Margin- oder Futures-Trading sind für gehebelte Tokens keine Einschusszahlungen oder Sicherheitsleistungen erforderlich, und es gibt keine Liquidationsrisiken. Beachten Sie, dass gehebelte Tokens eine hohe Preisvolatilität aufweisen können. Trader sollten daher vorsichtig mit ihren Investitionen sein.",
  "etf.answer.six.content1": "i. Im Vergleich zum Spot-Markt ist der Markt für gehebelte Tokens mit höheren Risiken und Unsicherheiten behaftet. Das Halten von gehebelten Tokens kann zu häufigen Tagesgewinnen und -verlusten führen.",
  "etf.answer.six.content2": "ii. Der Rebalancing-Mechanismus und die Management-Gebühren bedeuten, dass Sie umso mehr Gebühren zahlen müssen, je länger Sie einen gehebelten Token halten. Trader sollten beim längerfristigen Halten von gehebelten Tokens mit Bedacht vorgehen.",
  "etf.answer.step1.content": "Sie können die gehebelten Tokens auf dem {brandName} Spot-Markt traden. Rufen Sie die entsprechende Seite für gehebelte Tokens auf und suchen Sie nach Ihren bevorzugten Tokens. Klicken Sie auf „Trade“, um zu kaufen oder zu verkaufen.",
  "etf.answer.step1.title": "i. Auf dem {brandName} Spot-Markt (empfohlen)",
  "etf.answer.step2.content": "{brandName} verarbeitet Abonnement- und Einlösungsanträge täglich um {unifiedSubmissionTimePoints}. Die Preise für Abonnements/Einlösungen werden durch die Ergebnisse der Abwicklung bestimmt, was bedeutet, dass es Unsicherheiten hinsichtlich des Zeitpunkts und der Preise gibt. Trader sollten daher vorsichtig mit ihren Investitionen sein.",
  "etf.answer.step2.title": "ii. Abonnement/Einlösung",
  "etf.answer.three": "Der Rebalancing-Mechanismus macht {brandName} Gehebelte Tokens zu einer guten Wahl für einseitige Marktbewegungen, aber zu einer schlechten Wahl bei schwankenden Märkten. Bei hoher Volatilität kann es zu höheren Verlusten innerhalb eines Tages kommen. Trader sollten daher vorsichtig mit ihren Investitionen sein.",
  "etf.answer.two": "Jeder {brandName} Gehebelte Token ist ein Einzelanteil an einem gehebelten Investmentfonds. Der Vermögensverwalter stellt sicher, dass die Renditen des Investmentfonds auf einem bestimmten Vielfachen des zugrundeliegenden Vermögenswerts basieren und dass die Trader die Erlöse aus dem Basiswert in dieser Höhe realisieren können. Übersteigt die Preisvolatilität auf der gegensätzlichen Marktseite den festgelegten Grenzwert, wird ein Rebalancing-Mechanismus zur Begrenzung des Nettoverlustes eingesetzt, um das Risiko zu senken.",
  "etf.apply.alert": "<div>Die tägliche Verarbeitung erfolgt um {unifiedSubmissionTimePoints}. Zeichnungs- und Rücknahmepreise basieren auf dem zuletzt abgeschlossenen Handel. </div> <div>Um Risiken oder Unsicherheiten zu reduzieren, empfehlen wir den Einsatz des Spothandels.</div> <div class='tip'>Bitte beachten Sie: Bei Zeichnung oder Einlösung erfolgt die Gutschrift Ihres Guthabens immer zum nächsten geplanten Bearbeitungszeitpunkt.</div>",
