  "export.csv": "CSV herunterladen",
  "export.csv.help": "Ihre CSV-Datei wird generiert. Je nach Größe kann es einige Zeit dauern. Sie werden benachrichtigt, sobald es zum Download bereitsteht.",
  "export.limit.help": "Sie haben das maximale Download-Limit innerhalb von 24 Stunden erreicht (maximales Limit: 5 mal/24h). Bitte versuchen Sie es später erneut.",
  "exportCsv.max.tip": "Alle 24 Stunden können bis zu 5 CSV-Dateien heruntergeladen werden, die jeweils bis zu 100 Tage an Daten enthalten.",
  "ezfMTJh5atRe4DxV8aHCCB": "<span>Bewertung der Markliquidität:</span> Berücksichtigen Sie die Marktliquidität der Plattform. Eine hohe Liquidität gewährleistet, dass Sie Trades schnell und zu Preisen nahe den Marktraten ausführen können, was das Risiko von Slippage und ungünstigen Preisbewegungen verringert.",
  "f024f611b7104000afb3": "Anfrage erhalten. Ergebnisse werden innerhalb von 30 Sekunden erwartet.",
  "f04f212c6c864000ab3f": "Wir führen regelmäßig Datensicherungen durch, um bei Datenverlust oder -beschädigung eine schnelle Wiederherstellung zu gewährleisten.",
  "f0c3a38dc9884000a01b": "Für neue Coins, die zu KuCoin Savings hinzugefügt werden, ist Auto Earn aktiviert.",
  "f13dde558c1e4000a40b": "Systemsicherheit",
  "f28d189c4db14000a9ab": "Sichere Entwicklung",
  "f2b84adc997e4000a9b4": "Unsere Reserven sind auf Cold-, Warm- und Hot-Wallets verteilt, wobei der Großteil der Vermögenswerte in Cold-Wallets gespeichert ist, auf die nicht direkt über das Internet zugegriffen werden kann, wodurch Risiken minimiert und Benutzergelder geschützt werden.",
  "f2e4a9a1d64e4000a1a0": "Vorherige:",
  "f3b1d516d30b4000abd0": "Inhalt",
  "f3befe03e4364000a82e": "Die Multi-Faktor-Authentifizierung (MFA) ist eine einfache und effektive Maßnahme, die eine zusätzliche Schutzebene bietet. Wenn MFA aktiviert ist, führen Sie zusätzlich zur Eingabe Ihres Benutzernamens und Passworts eine zweite Art der Überprüfung durch.\n\n{brandName} verwendet mehrere MFA-Methoden, darunter E-Mail-Bestätigungscodes, SMS-Codes und Google Authenticator. Darüber hinaus bietet unsere App biometrische Authentifizierungsoptionen wie Fingerabdruck und Gesichtserkennung, um Ihre Identität schnell und sicher zu überprüfen.\n\nWenn die Systemsicherheit erhebliche Anomalien bei dem Gerät und der IP-Adresse erkennt, mit denen Sie sich bei Ihrem Konto angemeldet haben, oder wenn sie der Ansicht ist, dass Ihre jüngste Aktion ein Risiko für die Sicherheit Ihres Kontos darstellt, werden E-Mail-Links verwendet, um die Überprüfung weiter zu verstärken. Dies trägt dazu bei, Kontoverletzungen durch Phishing-Angriffe, Telekommunikationsbetrug und verschiedene andere Bedrohungen zu verhindern.",
  "f47b94ef147c4000a250": "Verfügbar + Investiert (USDT)",
  "f5B3R5EgXkkHdXBGHyJ8Rm": "UID eingeben",
  "f5Zge54Cj2Ntd1RrAMMfCG": "Krypto-Mining ist entscheidend für Blockchain-Netzwerke und nutzt sowohl Hardware als auch Software, um mathematische Probleme zu lösen und die Miner in Kryptowährung zu belohnen. In diesem Leitfaden erfahren Sie mehr über die Vorteile, Risiken, Arten und die Rentabilität des Cloud-Minings und wie Sie Betrügereien verhindern können.",
  "f6a0c27b7fe04000a1e2": "{brandName} verwendet WAFs (Web Application Firewalls), um wichtige Anwendungen abzufangen und vor verschiedenen Arten von Webanwendungsangriffen zu schützen.",
  "f6c3cbe6a2ef4000a8f1": "1. Das System hilft Ihnen, Savings-Produkte für die von Ihnen ausgewählten Währungen mit den verfügbaren Guthaben auf Ihrem Finanzierungskonto zu abonnieren. Dies passiert täglich um 01:00 Uhr (UTC).",
  "f6fe83efb3fe4000a80e": "Eine Anti-Phishing-Phrase hilft, Phishing-Angriffe zu verhindern. Dieser Code kann in Ihren E-Mail-, Anmelde- und Auszahlungseinstellungen eingerichtet werden. Durch die Überprüfung, ob der Code beim Anmelden angezeigt wird, können Benutzer überprüfen, ob die Website echt oder eine Phishing-Website ist. Bei Verdacht auf eine Phishing-Seite sollten Sie diese sofort verlassen und Ihre Sicherheitseinstellungen ändern, um die Sicherheit Ihres Kontos zu gewährleisten.",
  "f919f92814284000a58e": "Isolierung sensibler Daten mit dedizierten Datenbanken und Containerisierung",
  "f9bea9fe0aa84000a87c": "Zinssätze: {coin1} bei {apr1}, {coin2} bei {apr2} und {coin3} bei {apr3}.",
  "f9f491b5cdfc4000a0f4": "Nächste:",
  "fGE718DTpKWRjLjqkZd1vw": "Isolierte Margin",
  "fJDifFBStUaxqY55wqPDTy": "Entdecken Sie die Vor- und Nachteile des Cloud-Minings, erkunden Sie die verschiedenen Arten, bewerten Sie die Rentabilität und lernen Sie, wie Sie sich in der sich ständig verändernden Landschaft der Kryptowährung von Betrügern fernhalten.",
  "fJphzCgJyYjCQZpBmQP3u2": "Preis am Halbierungstag",
  "fKfoegsqTyeALZAXupFD3u": "Block-Belohnungsverteilung",
  "fL7UnR7fGBuBmBj9ptbD76": "Pro",
  "fLqeckfJ16QX33Q7skx1Ch": "Es gibt bereits eine {coin} Adresse mit der gleichen Bemerkung. Achten Sie bei der Verwendung auf die Unterscheidung.",
  "fPoz13ans9Sg2oT2t2JU6z": "Auszahlungen eingefroren",
  "fQjMAkUAQSfPs29m44gwYz": "<span>Praxis, Lernen und Erwartungen verwalten:</span> Beginnen Sie mit einem Demo-Konto als Lernwerkzeug für das Copy-Trading. Nutzen Sie es als Gelegenheit, um sich über Markttrends zu informieren, verstehen Sie, dass der Handel Risiken birgt, und verwalten Sie Ihre Erwartungen entsprechend. Beachten Sie eventuell ansonsten anfallende Kosten und interagieren Sie mit der Community der Plattform für Einblicke und geteilte Erfahrungen.",
  "fQpHhmPrNjBjUC7CXtWzps": "Hier klicken, um erneut zu senden.",
  "fRZbnDHRT6v7UEKnj6JBjh": "<span>Aktualisieren Sie Ihr Wallet regelmäßig:</span> Durch die Aktualisierung der Software Ihrer Wallet stellen Sie sicher, dass Sie über die neuesten Sicherheitspatches und Korrekturen für bekannte Schwachstellen verfügen.",
  "fS2nK33jEnWrMjCAjhPD95": "Beacon Chain",
  "fSYjErHuwaNkXEGXUXwyog": "Bearbeiten",
  "fUA6YA8bfcBY9kyA2p8wNZ": "Verwenden Sie Ihr Wallet, um Transaktionen zu senden, mit Dapps zu interagieren, an DeFi teilzunehmen oder NFTs zu verwalten.",
  "fW2YErs1WarPGw8tr2XtGT": "Könnte die Transaktionsgebühren um das Zehn- bis Hundertfache senken.",
