  "hK852hz7hizKfY18GJ24zb": "Es ist ein Blockchain-Rollback aufgetreten. Derzeit sind Beträge aufgrund von entsprechenden Einzahlungen auf Ihrem Konto vorübergehend geschuldet. Einzelheiten können Sie Ihrer E-Mail entnehmen. Sobald Ihre Einzahlungen erneut bestätigt sind, werden die hinterlegten Kapitalien wiederhergestellt. Weitere Informationen finden Sie unter <a href='{supportLink}'>Blockchain Rollback Hilfe</a>.",
