  "mga4EL6RDBUme9BC5v5uUv": "(1) Betroffene Einzahlungen werden vorübergehend von Ihrem Konto abgezogen. Wenn der Saldo auf Ihrem Konto zur Deckung der erforderlichen vorübergehenden Abzüge ausreicht, können Sie Ihre anderen, nicht betroffenen Kapitalien weiterhin für den Handel verwenden.<br/>\n\n(2) Wenn der verfügbare Saldo auf Ihrem Konto nicht ausreicht, um die erforderlichen vorübergehenden Abzüge zu decken, entsteht ein geschuldeter Betrag. In diesem Fall werden die Kapitalien auf Ihrem Guthabenkonto und Handelskonto gesperrt. Gesperrter Betrag = (110 %) * (geschuldeter Betrag). <br/>\n\n(3) Wenn die Kapitalien auf Ihrem Finanzierungskonto und Handelskonto nicht ausreichen, um die einzufrierenden Beträge zu decken, werden die Auszahlungen vorübergehend eingeschränkt.<br/>\n\n(4) Wenn Ihr (geschuldeter Betrag) / (Gesamtkapital) > 50 % ist, werden die Transaktionen vorübergehend eingeschränkt.",
