  "pwEKwvfrfD9Kh6BvmdkwRx": "3. Rechtsgutachten, das den Token Ihres Projekts als Utility Token anerkennt (ein formelles Rechtsgutachten, das von einer etablierten Anwaltskanzlei in einer der folgenden Jurisdiktionen erstellt wurde: US, UK, EU, HK oder Singapur)",
