  "pzqPBTTuRx3rzsz61PfJh1": "Das eingelöste Kapital wird auf Ihr Finanzierungskonto eingezahlt.",
  "q1PW9RkfmqxFDXqywnVciR": "Aber das ist nicht alles! Nach seiner Fertigstellung wird Ethereum 2.0 die Ethereum-Blockchain weitaus skalierbarer, effizienter und kostengünstiger machen. Gute Dinge brauchen Zeit, um sich zu entwickeln, und die Ethereum Foundation hat diese bedeutende Entwicklung in mehrere Phasen unterteilt, von denen jede eine große Änderung an der Ethereum-Blockchain vornimmt.",
  "q2PuzNWLvYraYkDEDdWQ4q": "In einem Bitcoin Mining-Pool beispielsweise arbeiten die Miner zusammen, indem sie ihre Rechenressourcen bündeln, um ihre Chancen zu erhöhen, erfolgreich <a href='{url}'  target='_blank'>Bitcoin</a> Blöcke zu minen und Belohnungen zu erhalten.",
  "q4FUiCm1cs2CSZxbLKmqCD": "Neueinsteiger-Bonus: Bis zu <span>8.200 USDT</span> in Belohnungen!",
