  "rules": "Regeln",
  "rw5E4e7qdY2WBAmg3SZZ7t": "Ethereum 2.0 ist eines der wichtigsten Upgrades <a href='{ethurl}' target='_blank'>Ethereum-Blockchain</a>. Dieses Upgrade, auch bekannt als ETH 2.0 oder Serenity, zielt darauf ab, die Skalierbarkeit, Sicherheit und Nachhaltigkeit des Ethereum-Netzwerks zu verbessern. Es markiert eine Abkehr vom Strom <a href='{proofurl}' target='_blank'>proof-of-work</a> (PoW) <a href='{url}' target='_blank'>Konsensmechanismus</a> zu <a href='{stakeurl}' target='_blank'>proof-of-stake</a> (PoS), wodurch der Energieverbrauch erheblich gesenkt und die Transaktionsgeschwindigkeit verbessert wird.",
  "rwe9Dv77a5nb4hHi4QXnHi": "<span>Verwenden Sie eine Hardware-Wallet für zusätzliche Sicherheit:</span> Erwägen Sie die Verwendung einer Hardware-Wallet zum Speichern größerer Mengen an Kryptowährung. Hardware-Wallets halten Ihre privaten Schlüssel offline und machen sie so weniger anfällig für Online-Hackerversuche.",
